import Layout from "./component/layout/Layout";

function App() {
    return (
        <Layout>
       <section className="barner">barner</section>
       <section className="text">text</section>
       <section className="logo-list">logo list</section>
       <section className="image-text">image text</section>
       <section className="gallery-image-card">gallery image card</section>
       <section className="text"></section>
       <section className="galery-image-card"></section>
       <section className="testimonial"></section>
       <section className="image-text"></section>
       <section className="image-text"></section>
       <section className="galery-image-card"></section>
       <section className="text"></section>
       <section className="logo-list"></section>
       <section className="blog"></section>
       <section className="news-letter"></section>

        </Layout>


    );
}

export default App;


